import React from "react";

export const Headers = () => {
  return (
    <div className="m-10">
          <h1
            className="max-w-md text-5xl font-bold text-center md:text-5xl md:text-left"
          >
            The Logo
          </h1>
      <ul class="list-disc list-inside">
        <li>One</li>
        <li>Two</li>
        <li>Three</li>
      </ul>
    </div>
  );
};
